import './App.css';
import { useEffect } from 'react';
import { useState } from 'react';

import {Home} from './Home';
import {Restoranti} from './Restoranti';
import {Navigation} from './Navigation';
import {Qyteti} from './Qyteti';

import {BrowserRouter, Route, Routes ,NavLink} from 'react-router-dom';
import {Navbar,Nav} from 'react-bootstrap';

function App() {
  return (
    <BrowserRouter>
    <div className="container">
     <h3 className="m-3 d-flex justify-content-center">
       Admin Dashboard
     </h3>


     <Navbar bg="dark" expand="lg">
                <Navbar.Toggle aria-controls="basic-navbar-nav"/>
                <Navbar.Collapse id="basic-navbar-nav">
                <Nav>
                <NavLink className="d-inline p-2 bg-dark text-white" to="/">
                    Home
                </NavLink>
                <NavLink to="/restoranti" className="d-inline p-2 bg-dark text-white">
                    Restorantet
                </NavLink>
                <NavLink to="/qyteti" className="d-inline p-2 bg-dark text-white">
                    Qytetet
                </NavLink>

                </Nav>
                </Navbar.Collapse>
            </Navbar>
     <Switch>
       <Route path='/' component={Home} exact/>
       <Route exact path='/Restoranti' component={Restoranti} />
       <Route exact path='/Qyteti' component={Qyteti}/>
     </Switch>
    </div>
    </BrowserRouter>
  );
}

export default App;
